import React from "react";

const RepoItem = (props) => {

    return(
        <div className="repo-container" key={props.id}>
            <div className="repo-header">
                <div className="icon"></div>
                <h3 className="repo-title">{props.output.full_name}</h3>
            </div>
            <div className="repo-description">
                <p className="content">
                    {output.description}
                </p>
            </div>
            <div className="repo-footer">
                <span className="code-lang"><span className="circle"></span>{props.output.programmingLanguage.name}</span>
                <span className="stargazers">{props.output.stargazers}</span>
                <span className="forks">{props.output.forks}</span>
                <span className="contributors"><a href="#" className="contributors-link">Contributors</a></span>
            </div>
        </div>
    )

}

export default RepoItem;
